var TREEDATA = [];
//从后端的列表中获取第一级部门
function getTopDepFromList(list) {
    var arr = [];
    for (var i = 0; i < list.length; i++) {
        if (!list[i].parentId) {
            if (checkDepHasChildren(list[i], list)) {
                list[i].hasChildrenDepartments = true
            } else {
                list[i].hasChildrenDepartments = false
            }
            arr.push(list[i])
        }
    }
    return arr;
}
//判断这个部门是否有子部门，后端返回的节点没有字段标志说这个部门是否是父级部门
function checkDepHasChildren(item, list) {
    for (var i = 0; i < list.length; i++) {
        if (item.id + "" === list[i].parentId) {
            return true;
        }
    }
    return false;
}
//设置部门树的第一层
function setTreeData(data) {
    for (var i = 0; i < data.length; i++) {
        const dep = {};
        dep.title = data[i].goodsServiceName;
        dep.key = data[i].taxCode;
        dep.originData = data[i];
        if (data[i].hasChildrenDepartments) {
            dep.isLeaf = false;
            var list = getDepChildrenFromTreelist(data[i].id, TREELIST);
            setLeafByParentOID(list, dep);
        } else {
            dep.isLeaf = true;
        }
        TREEDATA.push(dep);
    }
}
//把子节点挂在父节点上
function setLeafByParentOID(childNodes, parentNode) {
    var children = [];
    for (var i = 0; i < childNodes.length; i++) {
        const dep = {};
        dep.title = childNodes[i].goodsServiceName;
        dep.key = childNodes[i].taxCode;
        dep.originData = childNodes[i];
        if (childNodes[i].hasChildrenDepartments) {
            dep.isLeaf = false;
            var list = getDepChildrenFromTreelist(childNodes[i].id, TREELIST);
            setLeafByParentOID(list, dep);
        } else {
            dep.isLeaf = true;
        }
        children.push(dep);
    }
    parentNode.children = children;
}

// 获取对应子部门从前端缓存的列表中
function getDepChildrenFromTreelist(depid, list) {
    var arr = [];
    for (var i = 0; i < list.length; i++) {
        if (list[i].parentId + "" === depid + "") {
            if (checkDepHasChildren(list[i], list)) {
                list[i].hasChildrenDepartments = true
            } else {
                list[i].hasChildrenDepartments = false
            }
            arr.push(list[i])
        }
    }
    return arr;
}
setTreeData(getTopDepFromList(TREELIST));

